import React, { useState } from 'react';
import './book.css';

export default function Book() {
  const [count, setCount] = useState(0);

  return (
    <div id="book">
      <h3>Book Title</h3>
      <img
        src="data:image/webp;base64,"
        alt="Book" height={100} width={100}
      />
      <div>
        <button onClick={() => setCount(count + 1)}>+</button>
        <span>{count}</span>
        <button onClick={() => setCount(count - 1)}>-</button>
      </div>
    </div>
  );
}
